	add("enema", "{\"term\":\"enema\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἔνεμα\u0027 (injection, clyster) from \u0027ἐνίημι\u0027 (to inject)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An injection of fluid into the rectum, usually for medical purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fluid so injected.\u0026lt;!-- Encyclopedic: Enemas are generally broken down into two categories. Retention enemas, as the name implies, are meant to be retained for a specified period of time, usually thirty minutes or longer, and may contain medication or agents such as mineral oil meant to soften stool. Cleansing enemas are meant to clear the colon of feces, usually to relieve constipation or prepare the colon for a medical procedure. Cleansing enemas are meant to trigger a bowel movement within a few minutes of administration. --\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("enemy", "{\"term\":\"enemy\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|enemy}}, {{m|enm|enemye}}, {{m|enm|enmy}}, from Old french (842-ca. 1400) {{m|fro|enemi}}, {{m|fro|anemi}} (Modern French {{m|fr|ennemi}}), from Latin {{m|la|inimīcus}}, from {{m|la|in-||not}} + {{m|la|amicus|amīcus|friend}}. Displaced Middle english (1100-1500) {{m|enm|feend||enemy}}, from Old english (ca. 450-1100) {{m|ang|fēond|enemy}}, which survived into Modern English as {{m|en|fiend}}, but with a different meaning.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who is hostile to, feels hatred towards, opposes the interests of, or intends injury to someone else\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He made a lot of \u0027\u0027enemies\u0027\u0027 after reducing the working hours in his department\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Crush the \u0027\u0027enemy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hostile force or nation; a fighting member of such a force or nation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"rally together against a common \u0027\u0027enemy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An alliance of such forces\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something harmful or threatening to anothe\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The very thing the 16 skiers and snowboarders had sought — fresh, soft snow — instantly became the \u0027\u0027enemy\u0027\u0027. Somewhere above, a pristine meadow cracked in the shape of a lightning bolt, slicing a slab nearly 200 feet across and 3 feet deep. Gravity did the rest\", \"priority\":8}]}, \"synonyms\":{}}");

