	add("energy", "{\"term\":\"energy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|énergie}}, from {{m|la|energia}}, from Ancient greek (to 1453) {{m|grc|ἐνέργεια||action, act, work}}, from {{m|grc|ἐνεργός||active}}, from {{m|grc|ἐν||in}} + {{m|grc|ἔργον||work}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The impetus behind all motion and all activity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/technology-quarterly/21578516-transport-new-train-technologies-are-less-visible-and-spread-less-quickly Ideas coming down the passage\u003dA “moving platform” schemeis more technologically ambitious than maglev trains even though it relies on conventional rails.This set-up solves several problems\u0026amp;nbsp;[\u0026amp;hellip;]. Stopping high-speed trains wastes \u0027\u0027energy\u0027\u0027 and time, so why not simply slow them down enough for a moving platform to pull alongside\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The capacity to do work\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There is an hour or two, after the passengers have embarked, which is disquieting and fussy.Stewards, carrying cabin trunks, swarm in the corridors. Passengers wander restlessly about or hurry, with futile \u0027\u0027energy\u0027\u0027, from place to place\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A quantity that denotes the ability to do work and is measured in a unit dimensioned in mass × distance²/time² (ML²/T²) or the equivalent\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Units\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"SI: joule (J), kilowatt-hour (kW·h)\u0026lt;!--in a strict sense, hours are not part of SI but are acceptable for use with SI--\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"CGS: erg (erg\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Customary: foot-pound-force, calorie, kilocalorie (i.e. dietary calories), BTU, liter-atmosphere, ton of TN\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An intangible, modifiable force (often characterized as either \u0027positive\u0027 or \u0027negative\u0027) believed to emanate from a person, place or thing and which is (or can be) preserved and transferred in human interactions; shared mood or group habit; a vibe, a feeling, an impression\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Phylameana L. Desy, \u0027The Everything Reiki Book\u0027, Body, Mind \u0026amp; Spirit, [http://books.google.com.au/books?id\u003dY96b_aWfWngC\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003dpositive+energy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d8Er9T4blHq2XiQeb-ZT6Bg\u0026amp;ved\u003d0CGAQ6AEwB\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003dpositive%20energy\u0026amp;f\u003dfalse p.130\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Reiki, much like prayer, is a personal exercise that can easily convert negative \u0027\u0027energy\u0027\u0027 into positive \u0027\u0027energy\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Christopher Johns, \u0027Becoming a Reflective Practitioner\u0027, John Wiley \u0026amp; Sons, [http://books.google.com.au/books?id\u003duvNiZvYpsu4C\u0026amp;pg\u003dPA15\u0026amp;dq\u003dpositive+energy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5FH9T5fGH-KdmQWWoZ2YBQ\u0026amp;ved\u003d0CGkQ6AEwCTg\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dpositive%20energy\u0026amp;f\u003dfalse p.15\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Negative feelings can be worked through and their \u0027\u0027energy\u0027\u0027 converted into positive \u0027\u0027energy\u0027\u0027. In crisis, normal patterns of self-organization fail, resulting in anxiety (negative \u0027\u0027energy\u0027\u0027). Being open systems, people can exchange this \u0027\u0027energy\u0027\u0027 with the environment and create positive \u0027\u0027energy\u0027\u0027 for taking action based on a reorganisation of self as necessary to resolve the crisis and emerge at a higher level of consciousness; that is, until the next crisis\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Anne Jones, \u0027Healing Negative Energies\u0027, Hachette, [http://books.google.com.au/books?id\u003dmHSjDZTPLmQC\u0026amp;printsec\u003dfrontcover\u0026amp;source\u003dgbs_ge_summary_r\u0026amp;cad\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dsalt%20bath\u0026amp;f\u003dfalse p.118\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"If you have been badly affected by negative \u0027\u0027energy\u0027\u0027 a salt bath is wonderful for clearing and cleansing yourself. Salt attracts negative \u0027\u0027energy\u0027\u0027 and will draw it away from you\", \"priority\":19}]}, \"synonyms\":{}}");

